      <LeftImageRightText />
      <Testimonial />
      <TeamBlock />
      <Appointment />

      <div className={classes.latest}>
        <div className={classes.latestTitle}>NEWS</div>
        <div className={classes.latestsubTitle}>Latest News</div>
      </div>

      <div className={classes.newsBlock}>
        <OneNewsBlock />
        <OneNewsBlock />
      </div>

      <BlogAndNewsBlock />
      <FAQ /> 

    </div>	  


{/*       








